function App() {



  return (
    <div className="App">
      <Header atual="Home Page"/>
      <main>
           <Card nome_site={Data[0].id} desc_site={Data[0].body_text} link_site={Data[0].a_link} link_img={Data[0].url_img}/> 
      </main>
      <Footer/>
    </div>
  );
}

export default App;
